import React from 'react';
import './App.css';
import { connect } from 'react-redux';
import {nameData} from './actions/formActions'
import { Container } from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';

class App extends React.Component{


  classes = {
    container: { 
      backgroundColor: '#ccf0e1', 
      height: '80vh', 
      marginTop:'10vh' 
    },
    root: {
      width: '45%',
      margin: '3%'
    },
    heading:{
      color: '#084177'
    }
  };


  doThing = () => {
    this.props.dispatch(nameData({firstName:'Max', middleName: 'tonk', lastName:'Payne'}))
  }

  render(){
    console.log(this.classes);
    return (
      <Container maxWidth="md">
            <Typography component="div" style={this.classes.container} border={1}>
              <form noValidate autoComplete="off" style={{height: "100%", display:'flex',flexDirection:'column', alignItems:'center'}}>
                <Box 
                display="flex"
                flexDirection="column"
                alignItems="center"
                p={3}
                style={{width: '80%'}}
                >
                    <h2 style={this.classes.heading}>Let's get your Name</h2>
                    <TextField style={this.classes.root} id="outlined-basic" label="First Name" variant="outlined" />
                    <TextField style={this.classes.root} id="outlined-basic" label="Middle Name" variant="outlined" />
                    <TextField style={this.classes.root} id="outlined-basic" label="Last Name" variant="outlined" />
                </Box>
                <Box
                display="flex"
                flexDirection="column"
                alignItems="center"
                p={3}
                style={{width: '20%'}}
                >
                    <Button variant="outlined" color="primary" >
                            Primary
                    </Button>
                </Box>
              </form>
            </Typography>
      </Container>
    );
  }
}

function mapStateToProps(state){
  return state;
}

export default connect(mapStateToProps)(App);
